import React from "react";

function Habit(props) {
  return (
    <div className="habit">
      <div className="habit-text">
        <h2>{props.title}</h2>
        <p>{props.description}</p>
      </div>
      <p className="habit-counter">{props.count}</p>
    </div>
  );
}

export default Habit;
